import React from "react";
import Table_column_child from "./Table_column_child";

function Table_column(props){
    console.log("Table_column")

    const style_table_column1_child = [
        "border-bottom",
        "border-bottom bg-primary",
        "pt-2"
    ]; 
    const style_table_column2_child = [
        "flex-wrap border-start bg-secondary",
        "flex-wrap border-start"
    ];
    const style_table_column3_child = [
        "flex-wrap border-start bg-danger",
        "flex-wrap border-start"
    ];
    const style_table_column4_child = [
        "border-bottom bg-secondary",
        "border-bottom"
    ];
    const style_table_column5_child = [
        "border-bottom border-start-0 border-0",
        "border-bottom border-start-0 bg-success border-0",
        "border-bottom"
    ];
    const style_table_column6_child = [
        "flex-wrap border-end border-start-0 bg-secondary border-0",
        "flex-wrap border-end border-start-0 border-0"
    ];
    const style_table_column7_child = [
        "flex-wrap border-end border-start-0 bg-warning border-0",
        "flex-wrap border-end border-start-0 border-0"
    ];
    const style_table_column8_child = [
        "border-top bg-secondary",
        "border-top"
    ];
     
    let result = [];
    
    if(props.style_column.includes("column-top-1")){
        for(let i=1; i<=8 ; i++){
            if(i !== 8 && i !== 5) 
                result.push(<Table_column_child num={i} ydakhal={props.ydakhal} table_column_children={`${style_table_column1_child[0]} column_child_1_4_5_8`} />)             
            else if(i === 5) 
                result.push(<Table_column_child num={i} table_column_children={`${style_table_column1_child[1]} column_child_1_4_5_8`} />)
            else if(i === 8) 
                result.push(<Table_column_child num={i} table_column_children={`${style_table_column1_child[2]} column_child_1_4_5_8`} />)
        }
    }else if(props.style_column.includes("column-top-2")){
        for(let i = 9; i<17; i++){
            (i === 12)? 
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column2_child[0]} column_child_2_3`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column2_child[1]} column_child_2_3`} />)
        }
    }else if(props.style_column.includes("column-top-3")){
        for(let i = 18; i<26; i++){
            (i === 22)? 
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column3_child[0]} column_child_2_3`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column3_child[1]} column_child_2_3`} />)
        }
    }else if(props.style_column.includes("column-top-4")){
        for(let i = 26; i<34; i++){
            (i === 29)? 
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column4_child[0]} column_child_1_4_5_8`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column4_child[1]} column_child_1_4_5_8`} />)
        }
    }else if(props.style_column.includes("column-top-5")){
        for(let i = 35; i<43; i++){
            if(i === 42) result.push(<Table_column_child num={i} table_column_children={`${style_table_column5_child[0]} column_child_1_4_5_8`} />)             
            else if(i === 39) result.push(<Table_column_child num={i} table_column_children={`${style_table_column5_child[1]} column_child_1_4_5_8`} />)
            else result.push(<Table_column_child num={i} table_column_children={`${style_table_column5_child[2]} column_child_1_4_5_8`} />)
        }
    }else if(props.style_column.includes("column-top-6")){
        for(let i = 43; i < 51; i++){
            (i === 46)?
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column6_child[0]} column_child_6_7`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column6_child[1]} column_child_6_7`} />)             
        }
    }
    else if(props.style_column.includes("column-top-7")){
        for(let i = 52; i < 60; i++){
            (i === 56)?
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column7_child[0]} column_child_6_7`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column7_child[1]} column_child_6_7`} />)             
        }
    }else if(props.style_column.includes("column-top-8")){
        for(let i = 60; i < 68; i++){
            (i === 63)?
             result.push(<Table_column_child num={i} table_column_children={`${style_table_column8_child[0]} column_child_1_4_5_8`} />)             
            :result.push(<Table_column_child num={i} table_column_children={`${style_table_column8_child[1]} column_child_1_4_5_8`} />)             
        }
    }


    return(
        <div className={`${props.style_column}`}>
            {result}
        </div>
    )
}
export default React.memo(Table_column);
